import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import axios from 'axios';
import '../styles/Dashboard.css';

const Dashboard = () => {
  const { user } = useAuth();
  const [restaurants, setRestaurants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Function to fetch restaurants
    const fetchRestaurants = async () => {
      try {
        console.log('Fetching restaurants...');
        const response = await axios.get('http://localhost:8080/api/public/restaurants');

        console.log('API Response:', response);
        console.log('Restaurant Data:', response.data);

        if (Array.isArray(response.data)) {
          setRestaurants(response.data);
        } else if (response.data && Array.isArray(response.data.data)) {
          // If the API wraps data in a data property
          setRestaurants(response.data.data);
        } else {
          console.error('Unexpected API response format:', response.data);
          setError('Unexpected API response format');
        }
      } catch (err) {
        console.error('Error fetching restaurants:', err);
        setError('Failed to load restaurants. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchRestaurants();
  }, []);

  // Render loading state
  if (loading) {
    return (
      <div className="dashboard-container">
        <div className="loading-spinner">Loading...</div>
      </div>
    );
  }

  // Render error state
  if (error) {
    return (
      <div className="dashboard-container">
        <div className="error-message">{error}</div>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Welcome, {user?.name || 'User'}</h1>
        <p>Find your favorite food from our top restaurants</p>
      </div>

      <div className="dashboard-content">
        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="action-buttons">
            <Link to="/restaurants" className="action-button">
              <i className="fas fa-utensils"></i>
              <span>Browse Restaurants</span>
            </Link>
            <Link to="/orders" className="action-button">
              <i className="fas fa-list"></i>
              <span>Your Orders</span>
            </Link>
            <Link to="/profile" className="action-button">
              <i className="fas fa-user"></i>
              <span>Your Profile</span>
            </Link>
          </div>
        </div>

        <div className="featured-restaurants">
          <h2>Featured Restaurants</h2>

          {/* Debug info - remove after testing */}
          <div style={{background: '#f0f0f0', padding: '10px', marginBottom: '20px', color: '#333'}}>
            <p><strong>Debug:</strong> Fetched {restaurants.length} restaurants</p>
          </div>

          {restaurants && restaurants.length > 0 ? (
            <div className="restaurant-grid">
              {restaurants.map(restaurant => (
                <Link 
                  to={`/restaurants/${restaurant.id}`} 
                  className="restaurant-card" 
                  key={restaurant.id}
                >
                  <div 
                    className="restaurant-image-placeholder"
                    style={{
                      backgroundImage: restaurant.imageUrl ? `url(${restaurant.imageUrl})` : 'none',
                      backgroundSize: 'cover',
                      backgroundPosition: 'center'
                    }}
                  ></div>
                  <div className="restaurant-info">
                    <h3>{restaurant.name}</h3>
                    <p>Cuisine: {restaurant.cuisine}</p>
                    <p>⭐ {restaurant.rating !== undefined ? restaurant.rating : '0.0'}</p>
                  </div>
                </Link>
              ))}
            </div>
          ) : (
            <div>
              <p className="no-data-message">No restaurants available at the moment.</p>
              {/* Add direct link to a restaurant we know exists */}
              <p>Try viewing <Link to="/restaurants/2">this restaurant</Link> directly.</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
